import React from 'react'

function CardDetails({ title, price, backgroundImage }) {
    return (
      <div className="p-6 flex flex-col items-center">
        <img src={backgroundImage} alt={title} className="rounded-xl mb-4" />
        <h2 className="text-4xl font-bold te">{title}</h2>
        <p className="text-2xl">{price}</p>
      </div>
    );
  }

export default CardDetails
